let old_world = () => {
  let component = `


        <div class="position_relative height_100vh width_100 bg_yellow float_left">
            <div class="position_absolute bottom_0 height_50vh width_100 background_dark_yellow_9 opacity_05 float_left"></div>

            <canvas id="world" class="world position_absolute bottom_0 right_0 margin_auto width_100 height_100vh margin_auto float_left">
                  
                    <div class="sky-box"></div>
                    <div class="ground"></div>
                    <div class="gradient"></div>
            </canvas>
        
        </div>
      `;
  setTimeout(() => {
    const CANVAS = document.getElementById("world");
    const SKY_BOX = document.getElementsByClassName("sky-box")[0];
    const CTX = CANVAS.getContext("2d");
    const SENSITIVITY = 0.04;
    const SPRITES = [];
    const CAMERA_INIT = {
      x: 0,
      y: -1.3,
      z: -3
    };
    const ELEMENTS = {
      trees: {
        number: 50,
        range: {
          x: 10,
          y: 0,
          z: 10
        },
        origin: {
          x: 0,
          y: 0,
          z: 0
        },
        urls: [
          "https://goo.gl/gCzXR4",
          "https://goo.gl/DFsMwX",
          "https://goo.gl/JqoxHz",
          "https://goo.gl/9Su5pW",
          "https://goo.gl/YTQwiJ",
          "https://goo.gl/rUQVhu"
        ]
      },
      clouds: {
        number: 30,
        range: {
          x: 10,
          y: 0.5,
          z: 10
        },
        origin: {
          x: 0,
          y: 2,
          z: 0
        },
        urls: ["https://goo.gl/HgEjL9"]
      },
      groundItems: {
        number: 20,
        range: {
          x: 10,
          y: 0,
          z: 10
        },
        origin: {
          x: 0,
          y: 0,
          z: 0
        },
        urls: [
          "https://goo.gl/yJGDoR",
          "https://goo.gl/g4N9Lp",
          "https://goo.gl/Agqp41"
        ]
      }
    };

    let width, height, camera, imagesToLoad;
    let worldRot = 0;
    let dWorldRot = 0;
    let time = 0;
    let loadedImages = 0;

    class Vector {
      constructor(x, y, z) {
        this.x = x;
        this.y = y;
        this.z = z;
      }
      project() {
        const DZ = height / (camera.z - this.z);
        const PX = (camera.x + this.x) * DZ;
        const PY = (camera.y + this.y) * DZ;
        return {
          x: PX + width / 2,
          y: PY + height / 2,
          dz: DZ,
          z: this.z
        };
      }
      rotate(ang) {
        const COS = Math.cos(ang);
        const SIN = Math.sin(ang);
        const X = this.x;
        const Y = this.y;
        const Z = this.z;
        this.x = X * COS - Z * SIN;
        this.z = X * SIN + Z * COS;
      }
    }

    class Sprite {
      constructor(v, images) {
        this.sz = 2;
        this.v = v;
        this.image = images[(Math.random() * images.length) | 0];
        this.xl = this.image.naturalWidth * this.sz;
        this.yl = this.image.naturalHeight * this.sz;
      }
      rotate(ang) {
        this.v.rotate(ang);
      }
      render() {
        const P = this.v.project();
        const SZ = P.dz / height;
        const X_OFFS = this.xl / 6;
        if (outOfBounds(P.z, P.x + X_OFFS, P.y, this.xl * SZ, this.yl * SZ))
          return;
        CTX.beginPath();
        CTX.drawImage(
          this.image,
          P.x + X_OFFS,
          P.y,
          this.xl * SZ,
          this.yl * SZ
        );
        CTX.closePath();
      }
    }

    function outOfBounds(z, x, y, xl, yl) {
      return (
        z <= camera.z || x < 0 || y < 0 || x >= width - xl || y >= height - yl
      );
    }

    function signedRandom(n) {
      return n * (Math.random() - Math.random());
    }

    const renderSprites = () => {
      SPRITES.sort((a, b) => b.v.z - a.v.z);
      for (let s of SPRITES) {
        s.rotate(dWorldRot);
        s.render();
      }
    };

    const updateSkyBox = () => {
      SKY_BOX.style.backgroundPosition =
        -((worldRot / Math.PI) * 2) * 100 + "%";
    };

    const loop = () => {
      worldRot += dWorldRot;
      CTX.clearRect(0, 0, width, height);
      updateSkyBox();
      renderSprites();
      ++time;
      requestAnimationFrame(loop);
    };

    const create = e => {
      for (let i = 0; i < e.number; ++i) {
        const X = e.origin.x + signedRandom(e.range.x);
        const Y = e.origin.y + signedRandom(e.range.y);
        const Z = e.origin.z + signedRandom(e.range.z);
        SPRITES.push(new Sprite(new Vector(X, Y, Z), e.images));
      }
    };

    const go = () => {
      camera = new Vector(CAMERA_INIT.x, CAMERA_INIT.y, CAMERA_INIT.z);
      for (let i in ELEMENTS) create(ELEMENTS[i]);
      loop();
    };

    const setDim = () => {
      width = window.innerWidth;
      height = window.innerHeight;
      CANVAS.width = width;
      CANVAS.height = height;
    };

    const handleLoadImage = () => {
      ++loadedImages;
      if (loadedImages === imagesToLoad) go();
    };

    const preload = function(o) {
      o.images = [];
      for (let i = 0; i < o.urls.length; ++i) {
        o.images.push(new Image());
        o.images[o.images.length - 1].src = o.urls[i];
        o.images[o.images.length - 1].addEventListener("load", handleLoadImage);
      }
    };

    const preloadImages = () => {
      imagesToLoad = (() => {
        let total = 0;
        for (let i in ELEMENTS) {
          total += ELEMENTS[i].urls.length;
        }
        return total;
      })();
      for (let i in ELEMENTS) {
        preload(ELEMENTS[i]);
      }
    };

    const handleMouseMove = e => {
      const MOUSE_X = event.clientX - width / 2;
      dWorldRot = (-MOUSE_X / width) * SENSITIVITY;
    };

    const listen = () => {
      document.addEventListener("mousemove", handleMouseMove, false);
      window.onresize = setDim;
    };

    (() => {
      setDim();
      updateSkyBox();
      preloadImages();
      listen();
    })();
  }, 5000);

  return component;
};

