let element_slider_1 = () => {
  let anchor = 0;
  let i = 0;
  let array = [
    {
      title: "Shannon Sharpe"
    },
    {
      title: "Shannon Sharpe"
    },
    {
      title: "Shannon Sharpe"
    },
    {
      title: "Shannon Sharpe"
    },
    {
      title: "Shannon Sharpe"
    },
    {
      title: "Shannon Sharpe"
    }
  ];
  let random_int = randomizer();

  let element_slider_1_default_content = () => {
    let content = "";

    for (let i = 0; i < array.length; i++) {
      if (i == anchor) {
        content = "";
        content += array[i].title;
        content += "anchor:" + anchor;
      }
    }

    return content;
  };

  let update = () => {
    document.getElementById(
      `element_slider_1_content${random_int}`
    ).innerHTML = element_slider_1_default_content();
  };

  let component = `
    <div id="element_slider_1_${random_int}" class="width_100 float_left position_relative margin_auto text_align_center">\
      <div id="element_slider_1_content${random_int}" class="width_100 float_left position_relative text_align_center">${element_slider_1_default_content()}</div>\
      <div id="element_slider_1_content_anchorDown${random_int}" class="z_index_1 gui_arrow_left width_5vh height_5vh float_left position_relative"></div>\
      <div id="element_slider_1_content_anchorUp${random_int}" class="z_index_1 gui_arrow_right width_5vh height_5vh float_right position_relative"></div>\
    </div>\
  `;

  // add event listeners
  setTimeout(() => {
    update();
    document
      .getElementById(`element_slider_1_content_anchorUp${random_int}`)
      .addEventListener("click", event => {
        if (anchor < array.length - 1) {
          anchor += 1;
          update();
        }
      });

    document
      .getElementById(`element_slider_1_content_anchorDown${random_int}`)
      .addEventListener("click", event => {
        if (anchor > 0) {
          anchor -= 1;
          update();
        }
      });
  }, 1);

  return component;
};

